import os
import shutil
from sklearn.model_selection import train_test_split

# Define o caminho para seus dados originais (imagens e anotações)
data_path = 'dataset/images'

# Define os caminhos onde as pastas divididas serão criadas
output_path = 'dataset/yolo'
os.makedirs(output_path, exist_ok=True)

# Lista todos os arquivos de imagem
all_images = [os.path.join(data_path, f) for f in os.listdir(data_path) if f.endswith('.png')]

# Divide os dados em treinamento, validação e teste
train_images, val_test_images = train_test_split(all_images, test_size=0.3, random_state=42)
val_images, test_images = train_test_split(val_test_images, test_size=0.5, random_state=42)

# Função para copiar arquivos
def copy_files(file_list, dest_folder):
    os.makedirs(os.path.join(output_path, dest_folder, 'images'), exist_ok=True)
    os.makedirs(os.path.join(output_path, dest_folder, 'labels'), exist_ok=True)
    for image_file in file_list:
        # Copia a imagem
        shutil.copy(image_file, os.path.join(output_path, dest_folder, 'images'))
        # Copia a anotação correspondente
        label_file = image_file.replace('.png', '.txt')
        if os.path.exists(label_file):
            shutil.copy(label_file, os.path.join(output_path, dest_folder, 'labels'))

# Copia os arquivos para as pastas criadas
copy_files(train_images, 'train')
copy_files(val_images, 'val')
copy_files(test_images, 'test')

# Cria o arquivo data.yaml
